import React from "react";
import {Link } from "react-router-dom";

export function Header(){
    return(<div className="header">
                <ul className="nav justify-content-center">
                    <li className="nav-item">
                        <Link to="/" className="nav-link-white">Домашня сторінка</Link>
                    </li>
                    <div className="linksNav">
                    <Link to="revision" className="nav-link link-primary">Перегляд</Link>
                    <Link to="additions" className="nav-link link-primary">Додати нову техніку</Link>
                    <Link to="transfer" className="nav-link link-primary">Виписати наряд</Link>
                    </div>
                    {/* <li class="nav-item">
                        <a class="nav-link" href="#">Контакти</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">Про програму</a>
                    </li> */}

                </ul>
            </div>
        );
}
